Polarization indicator: 00 = Horizontally polarized or polarization no&hellip;
Map: SMF70BPD Based on: flags_polarization Description Polarization indicator: 00 = Horizontally polarized or polarization not indicated, 01 = Vertically polarized with low entitlement, 10 = Vertically polarized with medium entitlement, 11 = Vertically polarized with high entitlement
Post-Processed Flags postprocessor for multiple bit mapping.

LPAR-System name
Map: SMF70BCT Based on: lpar_name, system_name Post-Processed The field is created using the following pseudocode:
return lpar_name.cat(system_name, &#39;-&#39;)

I/O interrupt rate
Map: SMF70CPU Based on: interval, count_slh, count_tpi Post-Processed The field is created using the following pseudocode:
return (count_slh + count_tpi) / interval.total_seconds()

