Map: SMF70CTL Based on: inb Description Simplified Diagnose X'204&rsquo; data provided for system running as z/VM guest. CPU consumption by z/VM itself provided with partition data section named &ldquo;PHYSICAL&rdquo;
Post-Processed This virtual field corresponds to the flag at bit-position 5 of field inb.
